INSERT INTO `items` (`id`, `category_id`, `hide`, `name_en`, `name_he`, `desc_en`, `desc_he`, `price`, `sort`) VALUES
(1, 2, 0, 'Angus Burger', 'אנגוס בורגר', 'Angus Burger: 250 grams of quality entrecote beef with mayonnaise, mustard, barbecue, lettuce, onions, fried onions, pickles and tomatoes.', 'אנגוס בורגר\n250 גרם בשר אנטריקוט איכותי.  בתוספת מיונז, חרדל, ברביקיו, חסה, בצל, בצל מטוגן, מלפפון חמוץ ועגבניה.\nתוספות בתשלום לבחירה: פורטובלו 4 ₪ | ביצה 4 ₪ | 50 גר'' חזה אווז 8 ₪', 40, 100),
