(413, 64, 0, 'Balkan', 'בלקני', 'Ciabatta, pesto, Bulgarian cheese, cream cheese, roasted peppers and eggplant. Served hot', 'ג''בטה, פסטו, גבינה בולגרית, גבינת שמנת, פלפל קלוי וחציל. מוגש חם', 51, 512),
