(415, 64, 0, 'Smoked salmon', 'סלמון מעושן', 'Ciabatta, cream cheese, smoked salmon, hard-boiled egg, lettuce, tomato and green onion', 'ג''בטה, גבינת שמנת, סלמון מעושן, ביצה קשה, חסה, עגבנייה ובצל ירוק', 56, 514),
(416, 64, 0, 'Haloumi cheese burger', 'בורגר חלומי', 'Hamburger bun filled with seared haloumi cheese, tzatziki, lettuce, tomato, red onion and pickles', 'לחמניית המבורגר, חלומי צרוב, צזיקי, חסה, עגבנייה, בצל סגול ומלפפון חמוץ', 54, 515),
(417, 64, 0, 'Greg toast', 'טוסט גרג', 'Bagel with butter, garlic, cheese, tomato, onion and boiled egg', 'בייגל, חמאת שום, גבינה צהובה, עגבנייה, בצל וביצה קשה', 47, 516),
(418, 64, 0, 'American bagel', 'בייגל אמריקאי', 'Open bagel with cream cheese, pesto and mozzarella gratin', 'בייגל פתוח, פסטו וגבינת שמנת מוקרם במוצרלה', 53, 517),
(419, 64, 0, 'Sabich torilla', 'טורטייה סביח משופר', 'Eggplant, tomato, potato, hard-boiled egg, falafel balls, tahini, jalapeno, cumin and parsley, wrapped in a crispy tortilla', 'חציל, עגבנייה, תפו"א, ביצה קשה, כדורי פלאפל, טחינה, חלפיניו, כמון ופטרוזיליה במעטפת טורטייה פריכה', 47, 518),
