(422, 65, 0, 'Small Greek salad', 'יווני קטן', 'Sliced tomatoes, halved cherry tomatoes, cucumber, pepper, lettuce, red onion, olives, sliced Bulgarian cheese with oregano and olive oil', 'פלחי עגבנייה, שרי חצוי, מלפפון, פלפל, חסה, בצל סגול, זיתי קלמטה, פרוסת בולגרית עם אורגנו ושמן זית', 34, 521),
(423, 65, 0, 'Namas', 'נאמס', 'Fried rice dumplings filled with vegetables, cilantro and bean noodles, seasoned with Indonesian sauce.  Served with lettuce, spicy chilli rings and mint. Spicy.', 'כיסוני בצק אורז מטוגנים במילוי ירקות טריים, כוסברה ואטריות שעועית.\nמוגשים על רוטב אינדונזי בעלי חסה, טבעות צ''ילי חריף ועלי נענע. חריף.', 37, 522),
(424, 65, 0, 'Polenta', 'פולנטה', 'Soft corn polenta stir-fried with mushrooms, walnuts and grated Bulgarian cheese', 'פולנטה תירס רכה עם פטריות, מוקפצות, אגוזי מלך ובולגרית מגורדת', 36, 523),
(425, 65, 0, 'Fish Croquettes ', 'קרוקט דג ים', 'Breaded fish and potato croquettes seasoned with herb aioli', 'לביבות תפו"א ודג בציפוי פריך ואיולי עשבי תיבול', 37, 524),
(426, 65, 0, 'Indian Samosa', 'סמוסה הודית', 'Indian dumplings stuffed with peas, potatoes and seasoned with yogurt, curry and avocado', 'כיסוני בצק הודיים ממולאים בתפו"א ואפונה עם מתבלים של יוגורט, קארי ואבוקדו', 32, 525),
(427, 65, 0, 'Pastilla', 'פסטייה', 'Pastry stuffed with fried mozzarella, yellow, feta, onions, mushrooms, parsley and cranberries, spiced with fine cinnamon. Served topped with tahini, sesame and date honey', 'רולים מטוגנים ממולאים במוצרלה, צהובה, פטה, בצל מטוגן, פטריות, פטרוזיליה וחמוציות, בתיבול קינמון עדין. מוגשת בעיטור טחינה, סילאן ושומשום', 39, 526),
(428, 66, 0, 'Greg''s Stuffed Vegetables', 'הממולאים של גרג', 'A selection of market vegetables stuffed with rice and dates on a bed of  tzatziki', 'מבחר ירקות השוק ממולאים באורז ותמרים ומונחים על צזיקי', 64, 527),
(429, 66, 0, 'Quiche', 'קיש', 'Wholewheat quiche filled with selected vegetables. Served with a side salad and tzatziki', 'קיש מחיטה מלאה במילוי משתנה של ירקות השוק. מוגש בליווי סלט אישי וצזיקי', 52, 528),
(430, 66, 0, 'Creamed Potatoes', 'תפו"א מוקרם', 'Potato cubes in a creamy mushroom sauce, baked in a stone oven and served with a side salad', 'קוביות תפו''''א ברוטב שמנת ופטריות, מוקרמות בתנור אבן, מוגש בליווי סלט אישי ', 46, 529),
(431, 66, 0, 'Masala Fish', 'דג מסאלה', 'Garden peas, potatoes, onions, green beans, cherry tomatoes, green onions and diced salmon in a garam masala and yogurt sauce. Served with white rice', 'אפונה גינה, תפו''''א, בצל, שעועית ירוקה, עגבניות שרי, בצל ירוק וקוביות סלמון ברוטב גראם מסאלה ויוגורט.  מוגש עם אורז לבן', 69, 530),
(433, 66, 0, 'Stir Fried Noodles', 'מוקפץ נודלס', 'Strips of onion, pepper, cabbage, mushrooms, green beans, carrots, sprouts, peas and onions, stir-fried noodles with teriyaki sauce. Dressed with crushed peanuts.', 'רצועות בצל, פלפל, כרוב, פטריות, שעועית ירוקה, גזר, נבטים, אפונה ובצל ירוק, מוקפצים עם נודלס ברוטב טריאקי. מוגש עם בוטנים גרוסים מעל', 56, 532),
(434, 66, 0, 'Salmon Pad Thai', 'פאד תאי סלמון', 'Wide rice noodles and stir fried salmon cubes with strips of onion, pepper, cabbage, mushrooms, carrots, green beans, sprouts, peas, onions and peanut sauce shredded spicy Pad Thai sauce. Served with a lemon quarter, sunflower sprouts and black sesame. Spicy.', 'אטריות אורז רחבות וקוביות סלמון מוקפצות עם רצועות בצל, פלפל, כרוב, פטריות, גזר, שעועית ירוקה, נבטים, אפונה, בצל ירוק ובוטנים גרוסים ברוטב פאד תאי פיקנטי. מוגש עם רבע לימון, נבטי חמנייה ושומשום שחור. חריף.', 69, 533),
(435, 67, 0, 'Fish & Chips', 'פיש אנד צ''יפס', 'Crispy fish, served with aioli sauce, herbs and a helping of thin chips. Served with a side salad.', 'דג פריך, מוגש עם רוטב איולי, עשבי תיבול וערימה של צ''יפס דק.\n מוגש עם סלט אישי ', 69, 534),
(436, 67, 0, 'Salmon in Lemon', 'סלמון בלימון', 'Norwegian salmon fillet baked in a stone oven lemon with herbs on a bed of peas, beans, onions, mushrooms, cherry tomatoes and olives sauteed in olive oil, parsley, garlic and lemon. Served with salad.', 'פילה סלמון נורווגי אשוי בתנור אבן בלימון ועשבי תיבול על מצע אפונה, שעועית, בצל, פטריות, עגבניות שרי וזיתי קלמטה מוקפצים בשמן זית, פטרוזיליה, שום ולימון. מוגש עם סלט אישי.', 84, 535),
(437, 67, 0, 'Sea Bass Fillet', 'פילה לברק', 'Pan seared sea bass fillet, on a bed of spaghetti with olive oil, olives, tomatoes, peas and almonds. Served with salad.', 'פילה לברק צרוב במחבת, מונח על ספגטי בשמן זית, זיתי קלמטה, עגבניות, אפונה ושקדים קלויים. מוגש עם סלט אישי.', 98, 536),
(438, 68, 0, 'Double Felafel Burger', 'דאבל פלאפל בורגר', 'Falafel patties, fried eggplant, tahini, jalapeno, pickles and tomato on a hamburger bun. Served with a stack of thin chips', 'קציצות פלאפל, חציל מטוגן, טחינה, חלפיניו, מלפפון חמוץ ועגבנייה בלחמניית המבורגר נימוחה. מוגש בליווי ערימה של צ''יפס דק', 49, 537);
