(3560, 732, 0, 'Wakame salad', 'סלט וואקמה', 'Japanese salad with bean noodles, wakame seaweed and pickles in a soy, lime, ginger and green onion marinade', 'סלט יפני עם אטריות שעועית, אצות וואקמה ושערות מלפפון בתחמיץ סויה, ליים, ג''ינג''ר ובצל ירוק', 24, 830),
(3561, 732, 0, 'Nam Nam salad', 'סלט נם נם', 'Various kinds of lettuce, cucumbers, red onion and fresh herbs, with crispy sweet potato fries and spicycrushed pecan in lemon mint vinaigrette', 'שלל חסות, מלפפונים, בצל אדום וירוק, עשבי תיבול רעננים עם צ''יפס בטטה קריספית ושברי פקאן מתובל בויניגרט נענע לימון', 32, 831),
(3562, 732, 0, 'Yum Kai salad', 'סלט יאם קאי', 'Fresh Thai Salad of chopped chicken on bean noodles with crispy shallots, spring and red onions, mint, coriander, Thai basil and spicy red chili in a nama falah sauce and squeezed lime, spicy', 'סלט תאילנדי רענן של עוף קצוץ על אטריות שעועית עם קריספי שאלוט, בצל ירוק וסגול, נענע, כוסברה, בזיל תאילנדי וצ''ילי אדום חריף ברוטב נאם פלה וליים סחוט, פיקנטי', 34, 832),
(3563, 732, 0, 'Papaya Salad', 'סלט פפאיה', 'Thai street salad with green papaya, cherry tomatoes, carrot, green beans, coriander and ground peanuts in chili and lemongrass sauce. Mildly spicy!', 'סלט רחוב תאילנדי עם פפאיה ירוקה, עגבניות שרי, גזר, שעועית ירוקה, כוסברה ובוטנים כתושים ברוטב צ''ילי ולמון גראס - פיקנטי!', 29, 833),
(3564, 732, 0, 'Malaya salad', 'סלט מאלאיה', 'Red and white cabbage, lettuce, carrots, spring onions, cilantro, red chili in a Malayan peanut sauce with crispy rice noodles. Spicy!', 'כרוב אדום ולבן, חסה, גזר, בצל ירוק, כוסברה, צ''ילי אדום ברוטב בוטנים מלאזי עם אטריות אורז פריכות. פיקנטי!', 36, 834),
(3565, 732, 0, 'Wings in kampai chili', 'כנפיים בצ''ילי קמפאי', '8 wing with onion rings in tempura, sesame and green onion', 'שמונה יחידות כנפיים עם טבעות בצל בטמפורה, שומשום ובצל ירוק', 29, 835),
(3566, 732, 0, 'Vegetable spring roll', 'ספרינג רול ירקות', 'Stuffed with bean noodles, carrots, sprouts and spring onion served with a sweet spicy chili sesame dip', 'במילוי אטריות שעועית, גזר, נבטים ובצל ירוק מוגש בליווי מטבל צ''ילי שומשום חריף מתוק', 15, 836),
(3567, 732, 0, 'Chicken Spring Roll', 'ספרינג רול עוף', 'Filled with chicken, bean noodles, vegetables, and herbs, served with sweet & spicy chili and sesame dip on the side', 'מילוי עוף, אטריות שעועית, גזר נבטים ובצל ירוק. מוגש בליווי מטבל צ''ילי שומשום חריף מתוק', 17, 837),
(3568, 732, 0, 'Chicken gyoza', 'גיוזה עוף', '4 pc crispy pastry dough filled with chicken, with a chili dip and sweet spicy chili sesame dip', 'ארבע יחידות כיסוני בצק פריך במילוי עוף עם מטבל צ''ילי ושמשום חריף מתוק', 22, 838),
